{
  "manifest_version": 3,
  "name": "Chess Study Tool - AI Analysis",
  "version": "3.7.0",
  "description": "Chess learning tool - reads board positions from chess.com or screenshots, analyzes with Stockfish, and suggests the best move.",

  "permissions": [
    "storage",
    "activeTab",
    "tabs",
    "sidePanel",
    "scripting"
  ],

  "host_permissions": [
    "<all_urls>",
    "https://lichess.org/*",
    "https://chess-api.com/*",
    "https://api.anthropic.com/*",
    "https://openrouter.ai/*",
    "https://open.bigmodel.cn/*"
  ],

  "background": {
    "service_worker": "src/background/service-worker.js",
    "type": "module"
  },

  "action": {
    "default_icon": {
      "16": "assets/icon16.png",
      "48": "assets/icon48.png",
      "128": "assets/icon128.png"
    },
    "default_title": "Open Chess Study Tool"
  },

  "side_panel": {
    "default_path": "src/panel/panel.html"
  },

  "icons": {
    "16": "assets/icon16.png",
    "48": "assets/icon48.png",
    "128": "assets/icon128.png"
  },

  "content_scripts": [{
    "matches": ["*://*.chess.com/*"],
    "js": ["src/content/chess-com.js"],
    "run_at": "document_idle"
  }],

  "commands": {
    "capture-analyze": {
      "suggested_key": {
        "default": "Alt+S",
        "mac": "Alt+S"
      },
      "description": "Capture and analyze chess position"
    }
  }
}

